import React, { Component } from 'react'
import { 
  MDBIcon, 
  MDBContainer,
  MDBRow,
  MDBCol
} from "mdbreact";
import "../index.css";

export default class Contenedor extends Component {
  render() {
    return (
      <div>
        <MDBRow around>
          <MDBCol sm="6"></MDBCol>
          <MDBCol xs="5" sm="5"></MDBCol>
        </MDBRow>
      </div>
    )
  }
}
